import React, { useState } from 'react';
import { useForm } from "react-hook-form";
import { Alert, Button, CustomInput } from 'components';
import { FormContainer, InputName, InputLastName, InputPhoneNumber, InputBirthday, InputEmail, InputPassword, Wrapper, Span, ButtonContainer } from './styled'
const Component = ({ onSubmit }) => {
    const [showAlert, setShowAlert] = useState(false)
    const { register, errors, handleSubmit } = useForm();

    // const onSubmit = async (dataProduct) => {
    //     console.log(dataProduct)
    // };
    return (
        <Wrapper>
            {showAlert && <Alert information={"Producto agregado correctamente"}
                onClick={() => setShowAlert(false)}
                setShowAlert={() => { setShowAlert(false); window.location.href = "/mis-productos" }} />}
            <FormContainer onSubmit={handleSubmit(onsubmit)}  >
                <InputName>
                    <CustomInput
                        type={"string"}
                        placeholder={"Ej. Rocky"}
                        label="Nombre"
                        {...register("firstName",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputName>
                <InputLastName>
                    <CustomInput
                        type={"string"}
                        placeholder={"Apellidos"}
                        label="Apellidos"
                        {...register("lastName",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputLastName>
                <InputPhoneNumber>
                    <CustomInput
                        type={"tel"}
                        placeholder={"3131150580"}
                        label="Ej. Numero de teléfono"
                        {...register("phoneNumber",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputPhoneNumber>
                <InputBirthday>
                    <CustomInput
                        type={"date"}
                        placeholder={"14/11/1999"}
                        label="Fecha de nacimiento"
                        {...register("birthday",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputBirthday>
                <InputEmail>
                    <CustomInput
                        type={"email"}
                        placeholder={"Ej.correo@correo.com"}
                        label="Correo electrónico"
                        {...register("email",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputEmail>
                <InputPassword>
                    <CustomInput
                        type={"password"}
                        placeholder={"*********"}
                        label="Contraseña"
                        {...register("password",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputPassword>
                <InputPassword>
                    <CustomInput
                        type={"password"}
                        placeholder={"*********"}
                        label="Confirma tu contraseña"
                        {...register("passwordValidate",)}
                    />
                    <Span>{errors?.name?.message}</Span>
                </InputPassword>
                <ButtonContainer>
                    <Button children={"Publicar producto"} type="submit" />
                </ButtonContainer>
            </FormContainer>
        </Wrapper>
    );
}

export default Component;
export { Component as SignUp }
